pragma solidity ^0.8.0;

import "./Path.sol";
import "./Storage.sol";
import "./Lib.sol";
import "../agnostic/UIntConverter.sol";
import "../Bank/Bank.sol";
import "../Quote/Quotator.sol";
import "../Delivery/Delivery.sol";

bytes32 constant MARKET = keccak256("Market");

contract Market is
    RepositoryContract,
    UIntConverter,
    MarketPathStorage,
    //MarketPathReader,
    MarketStorage
{
    using Array for uint64[];
    using Array for bytes32[];
    using MarketLib for SolutionSet;

    function id() public view virtual returns (bytes32) {return MARKET;}

    constructor(Repository rep_) RepositoryContract(rep_) {}

    function MarketPathKeccak() internal view virtual override returns (KeccakInverter)
    {
        return rep;
    }
    function MarketPathIsActiveFromTo(bytes32 fromto_) internal view virtual override returns (bool)
    {
        return _fromtoorders[fromto_].length !=0;
    }
    /////////////////////////////////////////////////////////////////////////////////////////
    //      storage
    /////////////////////////////////////////////////////////////////////////////////////////

    function __order(uint256 order_, bool showall)
        internal
        view
        returns (Order.InfoPublic memory orderpub_)
    {
        Order.Info memory _order = _orders[order_];
        (orderpub_.from, orderpub_.to) = rep.resolveBytes32Bytes32(
            _order.fromto
        );

        orderpub_.orderid = _order.orderid; //   // id of the order
        if (showall || (!Order.isHidden(_order.options))) {
            orderpub_.account = _order.account; // the user/account/client/customer
            orderpub_.qty = UInt64ToUInt256(_order.qty); // active qty
            if (Order.isPack(_order.options))
                orderpub_.granularity = orderpub_.qty;
            else if (_order.granularity != 0)
                orderpub_.granularity = UInt64ToUInt256(_order.granularity); // active qty
            else
                orderpub_.granularity = Bank(rep.get(BANK)).granularity(orderpub_.from);
            orderpub_.qtydone = UInt64ToUInt256(_order.qtydone); // qty bought or sold
            orderpub_.originalqty = UInt64ToUInt256(_order.originalqty); // original qty when the order was placed (qty and quote can be ajusted)

            if (Order.isIndexed(_order.options)) {
                orderpub_.originalquote = UInt64ToUInt256(_order.originalquote); // original quote when the order was placed (qty and quote can be ajusted)
                orderpub_.originalbasedquote = UInt64ToUInt256(
                    _order.originalbasedquote
                ); // original market quote when the order was placed (qty and quote can be ajusted)
                uint256 _qquote;
                (, _qquote, ) = Quotator(rep.get(QUOTATOR)).readOnly(
                    orderpub_.from,
                    orderpub_.to
                );
                require(_qquote != 0, "Quote: Not quoted");
                orderpub_.quote =
                    orderpub_.originalquote *
                    (_qquote / orderpub_.originalbasedquote);
            } else orderpub_.quote = UInt64ToUInt256(_order.quote); // current quote
        }
        orderpub_.expire = Order.isExpired(_order);
        orderpub_.state = _order.state; // uint8    // state of the order
        orderpub_.options = _order.options; // order options
    }

    function order(uint256 order_)
        public
        view
        returns (Order.InfoPublic memory)
    {
        return __order(order_, false);
    }
}
